import { INC_COUNT, DEC_COUNT } from "./constants";
const initialState = {
  num: 0,
  name: "My Counter",
};

const changeCount = (state = initialState, action) => {
  switch (action.type) {
    case INC_COUNT:
      return state.num + 1;
    case DEC_COUNT:
      return state.num - 1;
    default:
      return state.num;
  }
};

export default changeCount;
